                    <td className="orderdata">
                        status
                    </td>
                    <td className="orderdata">
                  <button 
                  className="btn1" 
                  onClick={() => setModalShow(true)}><span class="material-symbols-outlined">
visibility
</span></button>
                    </td>
            </tr>
        </table>
        </div>
        <MyVerticallyCenteredModal
        show={modalShow}
        onHide={() => setModalShow(false)}
      />
        </>
    )

}
